var tipuesearch = {"pages": [{'title': '高沁安', 'text': '學歷 : 國立虎尾科技大學精密機械工程科 2018~ \n 課外活動 : 科學會美宣組 2019/07 ~ 2021/06 \n \n GitHub倉儲 :\xa0 https://50733144.github.io/Chinan.github.io/ \n LinkedIn :  linkedin.com/in/chin-an-kao-8a895a212 \n Gmail : 50733144@gm.nfu.edu.tw \n \n', 'tags': '', 'url': '高沁安.html'}, {'title': '課程作品', 'text': "CNC車床加工 :\xa0 https://youtu.be/56PdHGlTlfE \n 題目:雞尾酒杯 \n 使用 SolidWorks繪製雞尾酒杯，並用 G-code撰寫CNC車床程式。 \n   \n \n 機電儀控實習LabVIEW :\xa0 https://youtu.be/2Qs6NPrgcAw \n 題目 : 簡易自動販賣機 \n 使用 LabVIEW撰寫販賣機程式，並且使用MyRIO製作出簡易實體販賣機。 \n \n \n 網際網路課程 :\xa0 https://youtu.be/oNEmm5F1pwU \n 學習如何管理github倉儲，並使用虛擬主機。 \n \n \n Scilab\xa0analysis : \n 在matlab也有相同的功能，則scilab是免費版的，兩者差別在於圖案的華麗度。 \n 進行四連桿分析，可預先到scilab網站下載。 \n scilab download ： https://www.scilab.org/download/6.1.0 \n \n 下載完成進入scilab，點選啟動sciNotes可在此記事本打入需要的程式碼。 \n \n 依據題目可以輸入需要的值及公式進行分析。 \n 例:一四連桿如下圖所示，其中桿件 2 為曲柄 ( 可旋轉 360 度 ) ，桿件 3 為連接桿，若桿件 1 長度為 100mm ，桿件 2 長度為 30mm ，桿件 3 長度為 80 mm ，桿件 4 長度為 60mm ， P 為桿件 3 上一點，夾角a=30 o ，試使用所付之 Scilab 程式繪製 P 點軌跡與q 3 與q 4 歷程圖。 \n \n 可將以上已知的數值帶入公式中，在SciNotes上打入程式碼，進行軌跡模擬。 \n clear\nclc\ndtr=%pi/180\ne1=1;e2=1;\nr1=100;r2=30;r3=80;r4=60;r3p=40;\nalpha=30*dtr;\ntheta2=(0:10:360)*dtr;\nfor i=1:1:length(theta2)\n   if i==1\n       theta3p(1)=70*dtr;\n       theta4p(1)=120*dtr;\n   else\n      theta3p(i)=theta3p(i-1);\n      theta4p(i)=theta4p(i-1);\n end\n while abs(e1)>0.01*dtr && abs(e2)>0.01*dtr\n    e1=r2*cos(theta2(i))+r3*cos(theta3p(i))-r4*cos(theta4p(i))-r1\n    e2=r2*sin(theta2(i))+r3*sin(theta3p(i))-r4*sin(theta4p(i))\n    delta3=(e1*cos(theta4p(i))+e2*sin(theta4p(i)))/(r3*sin(theta3p(i)-theta4p(i)));\n    delta4=(e1*cos(theta3p(i))+e2*sin(theta3p(i)))/(r4*sin(theta3p(i)-theta4p(i)));\n    theta3p(i)=delta3+theta3p(i);\n    theta4p(i)=delta4+theta4p(i);\nend\ne1=1;e2=1;\ntheta3(i)=theta3p(i)/dtr;\ntheta4(i)=theta4p(i)/dtr;\nXp(i)=r2*cos(theta2(i))+r3p*cos(theta3p(i)+alpha);\nYp(i)=r2*sin(theta2(i))+r3p*sin(theta3p(i)+alpha);\nend\nclf\n\nsubplot(1,2,1)\nplot2d(Xp,Yp,5,rect=[-10,5,50,65]);xgrid(1);\nxtitle('Yp vs Xp');\nxlabel('Xp');\nylabel('Yp');\ny=[theta3,theta4];\nsubplot(2,2,2)\nplot(theta2'/dtr,y);xgrid(1);\na=gca();\na.data_bounds=[0,0;400,200];\nxtitle('theta3, theta3 vs theta2','theta2')\nlegend('theta3','theta4')\n \n 打完程式碼之後，先儲存sce檔，再到執行頁面中打開剛才存取的檔案 \n \n 再按下執行。 \n \n 執行結束後就會得到我們需要的結果了。 \n \n \n \n 分析結果能讓我們知道，機構的運行軌跡，方便去辨識連桿是怎麼運動的。", 'tags': '', 'url': '課程作品.html'}, {'title': '證照&徽章', 'text': '證照 :\xa0 \n \n 機械加工丙級證照 \n \n P - TECH\xa0 徽章 :\xa0 \n \n Enterprise Design Thinking Practitioner \n Explore Emerging Tech \n Explorations into Mindfulness \n Basic Principles of Design \n IBM Blockchain Essentials V2 \n Working in a Digital World: Professional Skills \n \n LinkedIn 徽章 :\xa0 \n \n Microsoft PowerPoint \n \n \n', 'tags': '', 'url': '證照&徽章.html'}, {'title': '科學會作品', 'text': '精密機械工程科-科徽 :\xa0 \n 與另一位同學共同製作科服和科徽，並由全科投票後勝出。 \n 設計概念 :\xa0 PME是精密機械工程科簡寫，齒輪代表著大家同心協力帶動整個機械科的運轉，中央處理器的電路看似無限延伸象徵著精密機械科的各位能有無限可能的潛力，期許精密機械的同學會手作也會使用電腦就像電腦中央處理器一樣使整部電腦能夠運作作為最重要元件。 \n \n 精密機械工程科-第一屆科服 :\xa0 \n \xa0 \xa0  \xa0 \n \n 活動名牌 :\xa0 \n \xa0\xa0 我 \n 聖誕卡片 :\xa0 \n \n 活動海報 :\xa0 \n \n', 'tags': '', 'url': '科學會作品.html'}, {'title': '履歷製作', 'text': '110學年第1學期有職涯探索探索的課程，藉由IBM履歷工坊學習如何寫履歷。 \n 紀錄我的履歷成長史。 \n', 'tags': '', 'url': '履歷製作.html'}, {'title': 'October 2 2021', 'text': '第一次寫履歷。 \n \n', 'tags': '', 'url': 'October 2 2021.html'}, {'title': 'October 5 2021', 'text': '新增工作經驗和徽章，也把排版改得再精簡一點。 \n \n', 'tags': '', 'url': 'October 5 2021.html'}, {'title': 'October 7 2021', 'text': '關於我的內容順序對調。 \n \n', 'tags': '', 'url': 'October 7 2021.html'}, {'title': '專題製作', 'text': '專題題目:網際內容管理系統在精密機械教學與研究上的應用。 \n 專題目標:希望能在科學會電腦主機上安裝虛擬主機，並且建立論壇，讓五專畢業生和雲林工專的學長姐，能用gmail帳號登入論壇，就能在論壇上分享自己五專畢業後去求職和升學的建議。 \n 專題時間:每周四與老師討論問題，並執行本周任務。 \n 指導教授 : 嚴家銘 \n 專題組員 : 郭樺 林冠澔 高沁安 林侑昌 \n', 'tags': '', 'url': '專題製作.html'}, {'title': 'October 9', 'text': 'CMSIMDE太久沒有更新，所以在upgrade倉儲時遇到問題。 \n upgrade倉儲影片連連結: https://www.youtube.com/watch?v=WvkJ1wMAUE4&t=106s \n 問題一:init.py檔沒有複製到Y:\\tmp\\chinan所以發生了錯誤。 \n \n 解決辦法:複製 init.py檔到tmp/chinan附錄下 \n \n 問題二:因為沒有更新所以python未安裝pyopenssl，導致http無法獲得密碼模組支援，所以一直發生錯誤。並且現在ssl認證已經改了。 \n \n 解決:在y附錄下安裝pip install pyopenssl，再次啟動cmsimde，http就能啟用了。 \n 參考資料 :\xa0 https://blog.miguelgrinberg.com/post/running-your-flask-application-over-https \n \n', 'tags': '', 'url': 'October 9.html'}, {'title': 'Github倉儲管理', 'text': '我的倉儲： https://50733144.github.io/Chinan.github.io/ \n \n 指令碼： \n \n 從遠端更新倉儲指令碼： \n git  fetch較近的分支，然後與本地端的分支做合併，產生一個合併提交節點，同步到自己的倉庫。 \n git pull將遠端的倉儲直接取代掉原先自己的倉儲。 \n \n 接下來必須進入tmp /倉儲檔案/ cmsimde / up_dir以下檔案複製 \n \n 到tmp /倉儲檔案下，貼上取代現有檔案，並能完成改版。 \n \n 啟用動態網頁編輯碼： \n 原先啟用前，應進入cmsimde資料夾，然後打入python wsgi.py才可啟用動態編輯， \n 如今進入動態前剛剛，進入自己的資料夾，打入cms立即進入動態網頁進行編輯。 \n \n \n 轉成早期靜態指令碼： \n 原先需進入自己的資料夾，打入 git add，git commit，git push才可完成推送， \n 現在僅需打入acp“推送檔案名稱”即可完成推送。因為acp中包含了git  a  dd，git  c  ommit，git  p  ush，使用起來更方便。 \n \n', 'tags': '', 'url': 'Github倉儲管理.html'}]};